INSERT INTO `tests_old` VALUES (1,'readingAssesmentPart1','','','<access>\r\n<group id=\"3\"></group>\r\n<user id=\"3\"></user>\r\n</access>','<?xml version=\'1.0\' encoding=\'UTF-8\'?>\r\n<testdata>\r\n  <question>\r\n    <word>accent</word>\r\n    <contextsentence>People from England speak with a funny accent</contextsentence>\r\n    <meaning1>Way we do things</meaning1>\r\n    <meaning2>Way we speak </meaning2>\r\n    <meaning3>Way we taste </meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>afraid</word>\r\n    <contextsentence>The boy was afraid to show his teacher his work</contextsentence>\r\n    <meaning1>Not to care </meaning1>\r\n    <meaning2>To be brave</meaning2>\r\n    <meaning3>To be scared</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>banjo</word>\r\n    <contextsentence>The old man played the banjo while his wife sang a song</contextsentence>\r\n    <meaning1>Like a guitar</meaning1>\r\n    <meaning2>Like a stove</meaning2>\r\n    <meaning3>Like a drum</meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>better</word>\r\n    <contextsentence>Giving is always better than receiving</contextsentence>\r\n    <meaning1>Really bad </meaning1>\r\n    <meaning2>Just good</meaning2>\r\n    <meaning3>More than good</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>break</word>\r\n    <contextsentence>My friends and I enjoy eating sweets at break</contextsentence>\r\n    <meaning1>Time to work</meaning1>\r\n    <meaning2>Time to study</meaning2>\r\n    <meaning3>Time to play</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>brought</word>\r\n    <contextsentence>The girl brought 4 flowers to school today</contextsentence>\r\n    <meaning1>To buy</meaning1>\r\n    <meaning2>To bring</meaning2>\r\n    <meaning3>To take away</meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>carrying</word>\r\n    <contextsentence>The teacher walked into the class carrying his black notebook</contextsentence>\r\n    <meaning1>To hold in hand</meaning1>\r\n    <meaning2>To throw away</meaning2>\r\n    <meaning3>To get rid of</meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>children</word>\r\n    <contextsentence>There were 5 children in the Sunday school play.</contextsentence>\r\n    <meaning1>Mum and dad</meaning1>\r\n    <meaning2>kids</meaning2>\r\n    <meaning3>monkeys</meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>class</word>\r\n    <contextsentence>I really enjoy my karate class</contextsentence>\r\n    <meaning1>Place to play</meaning1>\r\n    <meaning2>Place to cook</meaning2>\r\n    <meaning3>Place to learn</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>comfortable</word>\r\n    <contextsentence>My old pair of shoes are more comfortable than my new ones</contextsentence>\r\n    <meaning1>At ease</meaning1>\r\n    <meaning2>Restless</meaning2>\r\n    <meaning3>Itchy </meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>cookies</word>\r\n    <contextsentence>They bakery in my street sell the best cookies in the world</contextsentence>\r\n    <meaning1>Vegetables</meaning1>\r\n    <meaning2>Biscuits</meaning2>\r\n    <meaning3>Cakes </meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>different</word>\r\n    <contextsentence>There are 7 different colours in a rainbow</contextsentence>\r\n    <meaning1>The same </meaning1>\r\n    <meaning2>Looks alike</meaning2>\r\n    <meaning3>Not the same</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>down</word>\r\n    <contextsentence>The fireman came down the ladder quickly</contextsentence>\r\n    <meaning1>Standing still</meaning1>\r\n    <meaning2>To the sky</meaning2>\r\n    <meaning3>To the floor</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>easier</word>\r\n    <contextsentence>It is easier to learn to read when you are young than when you are old</contextsentence>\r\n    <meaning1>Can\'t do </meaning1>\r\n    <meaning2>Can do </meaning2>\r\n    <meaning3>Try to do </meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>first</word>\r\n    <contextsentence>The first time we went to the zoo i got lost</contextsentence>\r\n    <meaning1>Number one</meaning1>\r\n    <meaning2>Number two</meaning2>\r\n    <meaning3>Number three</meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>followed</word>\r\n    <contextsentence>The speech was followed by a great dinner</contextsentence>\r\n    <meaning1>Go before</meaning1>\r\n    <meaning2>Go after</meaning2>\r\n    <meaning3>Stand next to</meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>friend</word>\r\n    <contextsentence>A good friend is someone you can trust</contextsentence>\r\n    <meaning1>stranger</meaning1>\r\n    <meaning2>Buddy or pal </meaning2>\r\n    <meaning3>Bully </meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>grandmother</word>\r\n    <contextsentence>I love it when people say that I look just like my grandmother</contextsentence>\r\n    <meaning1>My mom\'s sister </meaning1>\r\n    <meaning2>My mom</meaning2>\r\n    <meaning3>My mother\'s mom</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>group</word>\r\n    <contextsentence>A group of children in my class are going on field trip</contextsentence>\r\n    <meaning1>One person </meaning1>\r\n    <meaning2>Nobody </meaning2>\r\n    <meaning3>Many people</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>guitar</word>\r\n    <contextsentence>We love it when my uncle plays the guitar because then we can dance.</contextsentence>\r\n    <meaning1>Makes music</meaning1>\r\n    <meaning2>Bakes Cakes</meaning2>\r\n    <meaning3> Boils water </meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>house</word>\r\n    <contextsentence>The rich old man lives in a big house with many rooms</contextsentence>\r\n    <meaning1>Church </meaning1>\r\n    <meaning2>School</meaning2>\r\n    <meaning3>Home </meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>join</word>\r\n    <contextsentence>We will join in and sing with the choir</contextsentence>\r\n    <meaning1>Pull apart</meaning1>\r\n    <meaning2>Put together </meaning2>\r\n    <meaning3>Chase away</meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>knew</word>\r\n    <contextsentence>I knew all my work in the exam</contextsentence>\r\n    <meaning1>To know</meaning1>\r\n    <meaning2>Not to know</meaning2>\r\n    <meaning3>Just bought it</meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>liking</word>\r\n    <contextsentence>The boy got hurt at soccer now he walks with a limp</contextsentence>\r\n    <meaning1>Not to like</meaning1>\r\n    <meaning2>To eat something</meaning2>\r\n    <meaning3>To like</meaning3>\r\n    <answer>3</answer>\r\n  </question>\r\n  <question>\r\n    <word>limp</word>\r\n    <contextsentence>My mother always gives me peanut butter sandwiches for lunch</contextsentence>\r\n    <meaning1>To walk funny</meaning1>\r\n    <meaning2>To eat funny</meaning2>\r\n    <meaning3>To sing funny</meaning3>\r\n    <answer>1</answer>\r\n  </question>\r\n  <question>\r\n    <word>lunch</word>\r\n    <contextsentence>I might be going fishing with my dad</contextsentence>\r\n    <meaning1>Eat in the morning</meaning1>\r\n    <meaning2>Eat in the afternoon</meaning2>\r\n    <meaning3>Eat in the evening </meaning3>\r\n    <answer>2</answer>\r\n  </question>\r\n  <question>\r\n    <word>might</word>\r\n    <contextsentenc